/**
 * S3 config
 */
export class Config {
    /**
     * S3 bucket
     */
    bucket;
    /**
     * S3 credentials
     */
    credentials;
    /**
     * S3 endpoint
     */
    endpoint;
    /**
     * Treat bucket contents as public
     */
    public = true;
    /**
     * S3 region
     */
    region = `us-east-1`;
    /**
     * Get a config value
     *
     * @param key - {@link S3ClientConfig} key
     * @returns value - {@link S3ClientConfig} value
     */
    get(key) {
        return this[key];
    }
    /**
     * Set a config value
     *
     * @param key - {@link S3ClientConfig} key
     * @param value - {@link S3ClientConfig} value
     * @returns void
     */
    set(key, value) {
        this[key] = value;
    }
}
